import React from 'react';

function PlayerList({ players, addPlayerToTeam, team }) {
  return (
    <div>
      <h2>Available Players</h2>
      <ul>
        {players.map((player) => (
          <li key={player.id}>
            <span>{player.name} - {player.position} - Rating: {player.rating}</span>
            <button 
              onClick={() => addPlayerToTeam(player)} 
              disabled={team.includes(player) || team.length >= 11}
            >
              Add to Team
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PlayerList;
